def my_func(input1: str):
    if len(input1) < 1 or len(input1) > 20:
        return ""
    words = input1.split()
    result = []
    for word in words:
        parts = word.split('-')
        transformed = ''.join(part.capitalize() for part in parts)
        result.append(transformed)
    return ' '.join(result)
